import React, { useState } from "react";
import MenuIcon from "@mui/icons-material/Menu";
import CloseIcon from "@mui/icons-material/Close";
import { NavLink } from "react-router-dom";
import SearchIcon from "@mui/icons-material/Search";
import PersonIcon from "@mui/icons-material/Person";

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  const closeMenu = () => {
    setIsOpen(false);
  };

  return (
    <>
      <nav className="bg-blue-500">
        <div className="flex container items-center justify-between mx-auto p-4">
          <div>
            <h1 className="text-white">Cinemadine</h1>
          </div>
          <div className="md:hidden">
            <button onClick={toggleMenu}>
              <MenuIcon className="text-white text-sm" />
            </button>
          </div>
          <div className="hidden md:flex space-x-4 items-center">
            <NavLink
              to="/"
              className={({ isActive }) =>
                `${
                  isActive ? "text-themeYellow" : "text-white"
                } hover:text-themeYellow px-4 py-2 font-bold`
              }
            >
              Home
            </NavLink>
            <NavLink
              to="/about"
              className={({ isActive }) =>
                `${
                  isActive ? "text-themeYellow" : "text-white"
                } hover:text-themeYellow px-4 py-2 font-bold`
              }
            >
              About
            </NavLink>
            <NavLink
              to="/news"
              className={({ isActive }) =>
                `${
                  isActive ? "text-themeYellow" : "text-white"
                } hover:text-themeYellow px-4 py-2 font-bold`
              }
            >
              News
            </NavLink>
            <NavLink
              to="/contact"
              className={({ isActive }) =>
                `${
                  isActive ? "text-themeYellow" : "text-white"
                } hover:text-themeYellow px-4 py-2 font-bold`
              }
            >
              Contact
            </NavLink>
          </div>
          <div className="hidden md:flex space-x-4">
            <div>
              <SearchIcon className="text-white hover:text-themeYellow" />
            </div>
            <div>
              <PersonIcon className="text-white hover:text-themeYellow" />
            </div>
          </div>
        </div>
      </nav>

      {isOpen && (
        <div
          className="fixed inset-0 bg-black bg-opacity-75 flex flex-col justify-center items-center z-50"
          onClick={closeMenu}
        >
          <div className="bg-white">
            <button
              className="absolute top-4 right-4 text-white"
              onClick={toggleMenu}
            >
              <CloseIcon className="text-white text-3xl" />
            </button>
            <div className="flex flex-col space-y-4">
              <NavLink
                to="/"
                className={({ isActive }) =>
                  `${
                    isActive ? "text-themeYellow" : "text-white"
                  } text-xl hover:text-themeYellow px-4 py-2 font-bold`
                }
                onClick={closeMenu}
              >
                Home
              </NavLink>
              <NavLink
                to="/about"
                className={({ isActive }) =>
                  `${
                    isActive ? "text-themeYellow" : "text-white"
                  } text-xl hover:text-themeYellow px-4 py-2 font-bold`
                }
                onClick={closeMenu}
              >
                About
              </NavLink>
              <NavLink
                to="/news"
                className={({ isActive }) =>
                  `${
                    isActive ? "text-themeYellow" : "text-white"
                  } text-xl hover:text-themeYellow px-4 py-2 font-bold`
                }
                onClick={closeMenu}
              >
                News
              </NavLink>
              <NavLink
                to="/contact"
                className={({ isActive }) =>
                  `${
                    isActive ? "text-themeYellow" : "text-white"
                  } text-xl hover:text-themeYellow px-4 py-2 font-bold`
                }
                onClick={closeMenu}
              >
                Contact
              </NavLink>
            </div>
          </div>
        </div>
      )}
    </>
  );
};

export default Navbar;
